function setupInputFormatting(inputId, minValue, maxValue) {
    const inputElement = document.getElementById(inputId);

    if (inputElement) {
        // Événement input
        inputElement.addEventListener('input', function() {
            // Obtenir la valeur actuelle
            let currentValue = this.value;

            // Retirer le symbole et les espaces
            let numericValue = currentValue.replace(/[^\d]/g, '');

            // Vérifier si la valeur dépasse le maximum
            if (numericValue && parseInt(numericValue, 10) > maxValue) {
                // Ajuster à la valeur maximale
                numericValue = maxValue.toString();
            }

            // Mettre à jour l'input avec la valeur numérique (sans formatage)
            this.value = numericValue; // Mettre à jour avec la valeur numérique
        });

        // Événement de perte de focus
        inputElement.addEventListener('blur', function() {
            // Obtenir la valeur numérique actuelle
            let currentValue = this.value;
            let numericValue = parseInt(currentValue.replace(/[^\d]/g, ''), 10); // Convertir en entier

            // Vérifier si l'input est vide
            if (this.value.trim() === '') {
                this.value = ''; // Vider l'input si c'est vide
                return; // Sortir de la fonction
            }

            // Vérifier si la valeur est en dehors des limites
            if (isNaN(numericValue)) {
                numericValue = minValue; // Si la valeur n'est pas un nombre, appliquer la valeur minimale
            } else if (numericValue < minValue) {
                numericValue = minValue; // Mettre à la valeur minimale
            } else if (numericValue > maxValue) {
                numericValue = maxValue; // Mettre à la valeur maximale
            }

            // Formater la valeur à la perte de focus
